'''
LeetCode #2268 - Minimum Number of Keypresses prompt:

You have a keypad with 9 buttons, numbered from 1 to 9, each mapped to lowercase English letters. 
You can choose which characters each button is matched to as long as:

- All 26 lowercase English letters are mapped to.
- Each character is mapped to by exactly 1 button.
- Each button maps to at most 3 characters.

To type the first character matched to a button, you press the button once. To type the second 
character, you press the button twice, and so on.

Given a string s, return the minimum number of keypresses needed to type s using your keypad.

Note that the characters mapped to by each button, and the order they are mapped in cannot be changed.

Example 1:
Input: s = "apple"
Output: 5
Explanation: One optimal way to setup your keypad is shown above.
Type 'a' by pressing button 1 once.
Type 'p' by pressing button 6 once.
Type 'p' by pressing button 6 once.
Type 'l' by pressing button 5 once.
Type 'e' by pressing button 3 once.
A total of 5 button presses are needed, so return 5.

Example 2:
Input: s = "abcdefghijkl"
Output: 15
Explanation: One optimal way to setup your keypad is shown above.
The letters 'a' to 'i' can each be typed by pressing a button once.
Type 'j' by pressing button 1 twice.
Type 'k' by pressing button 2 twice.
Type 'l' by pressing button 3 twice.
A total of 15 button presses are needed, so return 15.

Constraints:
1 <= s.length <= 10^5
s consists of lowercase English letters.
'''

class Solution:
	# Time complexity: 	O(n + k), where n is size of s and k is size of most freq char
	# Space complexity: O(n)
	def minimumKeypresses(self, s: str) -> int:
		# count chars in s & map them to hashmap
		count, max_count = {}, 0
		for char in s:
			count[char] = 1 + count.get(char, 0)
			max_count = max(max_count, count[char])
		if len(count) <= 9:
			return len(s)
		# map freq of chars into arr from least freq -> most freq
		freq = [[] for idx in range(max_count + 1)]	# keep freq len to a minimum
		for key, val in count.items():
			freq[val].append(key)
		# Iter from most freq to least freq
		min_press = dig_cnt = cnt = 0
		for idx in range(len(freq) - 1, 0, -1):
			for char in freq[idx]:
				if char.isalpha():
					# 9 dig key lim reached; incr the num of keypresses needed by 1
					if dig_cnt % 9 == 0:
						cnt += 1
					min_press += cnt * count[char]
					dig_cnt += 1
					if dig_cnt >= len(count): 	# if iterated through all chars, stop
						return min_press

	# # Time complexity: 	O(n log n), where n is size of s
	# # Space complexity: O(n)
